{'sdk_element_id': 'BT-201-Contract', 'sdk_element_title': 'Modification Reason Description', 'sdk_element_xpath': '/*/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'test_data_xpaths': [{'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d7f9', 'test_data_id': '447107-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Aneks nr 11 z dnia 08.07.2024 r. - W związku ze stwierdzeniem konieczności wykonania robót zamiennych, dodatkowych, rozszerzających zakres: 
1)	odtworzenie rozebranej nawierzchni drogowej i przywrócenia nawierzchni do stanu pierwotnego (ze względu na konieczność zachowania przejazdu 
dla autocystern na teren składu MPS podczas trwającego litrażowania zbiorników paliwowych roboty odtworzeniowe nawierzchni będą mogły rozpocząć się po zakończeniu pomiarów); 
2)	wykonanie dojścia do obiektu nr 31 (wykonanie dojścia jest niezbędne dla prawidłowego funkcjonowania obiektu oraz w celu skutecznego odbioru inwestycji przez organy Nadzoru Budowlanego);
3)	zamontowanie systemu grzania rur przewodem grzewczym oraz wykonania otuliny termoizolacyjnej w płaszczu ochronnym, 
4)	pomalowanie elewacji (ścian zewnętrznych) obiektów 11.1; do 11.6; 12.1; 12.2; 13; 14.1; 14.2; 14.3; 15.1; 15.2; 16.1; 16.2; 17, którego nie uwzględniono w przedmiarach (pozostawienie ścian zewnętrznych bez malowania doprowadzi do ich degradacji w wyniku działania warunków atmosferycznych);
5)	wykonanie większej ilość drogi patrolowej w stosunku do przedmiaru;
6)	zamiana sposobu wykonania stanowisk ogniowych na wniosek Użytkownika (zgodnie z dokumentacją projektową wzdłuż zewnętrznego ogrodzenia terenu MPS należy wykonać cztery stanowiska ogniowe. Użytkownik, podczas spotkania dotyczącego sprawdzenia zgodności zaprojektowanego ogrodzenia z wymogami normy obronnej zwrócił uwagę na trudność utrzymania w stanie suchym stanowisk zagłębionych poniżej terenu gruntu i wystąpił z propozycją zamiany przedmiotowych stanowisk na naziemne (wykonane z prostokątnych bali drewnianych);
7)	zamontowanie 7 szt. zasuw DN250 zgodnie z projektem, a w większej ilości względem przedmiaru (w przedmiarze branży sanitarnej występuje niedoszacowanie – 6 szt.);
oraz zaniechania części robót:
1)	wykonane ilości prac ziemnych polegających na wykopaniu, przemieszczeniu mas ziemnych i zasypaniu wykopów w ilości dostosowanej do potrzeb technologii wykonania tych prac, tj. ilości prac mniejszej niż przyjęto w przedmiarze;
2)	wykonanie 555 szt. igłofiltrów, tj. ilości igłofiltrów mniejszej niż przyjęto w przedmiarze (582 szt.);
3)	faktyczna powierzchnia dróg betonowych (TYP 1, 2, 3) okazała się mniejsza niż w przedmiarze, który był przeszacowany;
4)	faktycznie wbudowane ilości krawężnika okazały się mniejsze niż w przedmiarze, który był przeszacowany;
5)	wykonanie żelbetowej płyty fundamentowej bez izolacji pionowych i poziomych;
6)	w związku z wydzieleniem przez Zamawiającego z części zakresu prac objętych prawem opcji (budynek nr 04) Wykonawca nie wbudował separatora i  fundamentu dla separatora SEP-3, 
7)	wykonanie mniejszej ilość fundamentów niż określa przedmiar (w przedmiarze pozostawiono płytę fundamentową separatora SEP-3, po rezygnacji z wykonania budynku 04 wykonanie fundamentu pod separator SEP-3 
było bezzasadne);
8)	wykonanie mniejszej ilości opaski z kostki betonowej przy obiekcie nr 10 (w przedmiarze przeszacowano ilości robót do wykonania);
9)	wykonanie tynku cienkowarstwowego mozaikowego na elewacji budynku nr 06 w ilości 56,97 m2 (przedmiar był przeszacowany – występuje omyłka obliczeniowa);
10)	rzeczywiste ilości robót związanych z wykonaniem izolacji fundamentów i zasypek obiektu nr 09 są mniejsze (przedmiar był przeszacowany);
11)	w Protokole Konieczności nr 14, obejmującym swym zakresem rezygnację z instalacji cieplnej niskoparametrowej do budynków nierealizowanych (objętych prawem opcji) w pozycjach  dotyczących płukania sieci preizolowanej, prób szczelności rurociągów i uruchomienia rurociągów sieci cieplnych nastąpiła pomyłka obliczeniowa. Powyższe pozycje wyjęto z przedmiaru z działu sieci preizolowanych wysokoparametrowych, podczas gdy wyjęte powinny zostać pozycje odnoszące się do sieci niskoparametrowej;
12)	zamontowanie mniejszej ilości zasuw żeliwnych kołnierzowych PN16, DN 250 względem przedmiaru z branży sanitarnej (przedmiar sieci zewnętrznej WPP przewidywał montaż 6 szt. zasuw, natomiast projekt nie przewiduje montażu żadnej z przedmiotowych zasuw);
13)	wykonanie zgodnie z projektem instalacji zewnętrznej CO pod istniejącą drogą patrolową z kostki betonowej dodatkowych dwóch rur osłonowych o długości 7 mb każda (w przedmiarze występuje omyłka obliczeniowa – uwzględniono wykonanie 2 rur osłonowych pod drogą dojazdową do terenu MPS o długości 12 mb każda); na podstawie Protokołu konieczności nr 18 zatwierdzonego w dniu 24.05.2024 r. zmniejszono wynagrodzenie wykonawcy - zmiana na podstawie art. 455 ust. 1 pkt 1 i pkt 4 ustawy z dnia 11 września 2019 r. Prawo zamówień publicznych.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d807', 'test_data_id': '425773-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': "Tijdens het opstellen van het originele contract voor CCTV in de regio Tiel/Nijmegen was uitbreiding van CCTV bij overnachtingshaven Spijk nog niet bekend. Dit geldt ook voor de renovatie van de verkeerspost Nijmegen. Door de renovatie blijkt er onvoldoende duidelijk beeld te zijn en is het noodzakelijk dat het huidige CCTV-systeem uitgebreid wordt. Er moeten op beide locaties meer camera’s geplaatst en onderhouden worden om te voldoen aan de wettelijke taak 'veilige scheepvaartbegeleiding'. Omdat de uitbreiding geïntegreerd moet worden in het netwerk dat door Swarco wordt onderhouden, is het technisch te risicovol om dat een andere partij dit te laten doen. De omstandigheden zijn gewijzigd welke ten tijde van het afsluiten van het originele contract niet konden worden voorzien door RWS. De aard van de opdracht wijzigt niet; het plaatsen en onderhouden van CCTV installaties. De prijs van de wijziging is niet hoger dan 50% van de oorspronkelijke opdrachtwaarde."}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d80d', 'test_data_id': '511729-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Two modifications of the contract were made to reflect impacts of the Covid-19 pandemic which were unforeseeable at the time of entry into of the O&M Contract and which impacted the contractor’s performance of the Operations and Maintenance Contract.  These modifications are summarised as follows: 
i)	A change to the contractual indexation provisions which allow for adjustments to payments of the Base Yearly Amount to the contractor as a result of annual changes to earnings of staff members performing the Services, which is calculated by reference to economic activities in the published Nomenclature of Economic Activities (“NACE”) index. The modification aligned the indexation mechanism to the most appropriate category of worker involved in the delivery of the services pursuant to the contract (rather than the NACE index identified in the contract, which grouped certain categories of worker together). This modification to the NACE Index resulted in an additional payment of €3,743,858 for the period to end of June 2024 (which was in addition to an earlier payment of €378,745 made in 2020 to reflect an initial assessment of the impacts of Covid-19 at the time). 
ii)	A revision to a contractual variation to deal with the impacts of the Covid-19 pandemic to provide additional relief for certain system performance deductions (e.g. Lost Kilometre Deductions, Excess Waiting Time Deductions, Fare Evasion Deductions, Light Rail Vehicle Maintenance and Infrastructure Maintenance Deductions) incurred by the contractor.  This modification included for additional relief in the form of a reimbursement of deductions previously charged against the contractor of €7,318,000 for the period 2020 to 2023 (which represented approximately 48% of the deductions applied / charged during this period).  The review and revision to the contractual variation also resulted in the reimbursement of the contractor for certain additional labour and sub-contractor costs incurred in performing the Services (i.e. seeking to run a full timetable) to the amount of €6,372,951 for the same period between 2020 to 2023. 
As noted above the contracting authorities have commenced the procurement competition for the next generation Luas Operations and Maintenance and therefore expect that the current / existing O&M contract will not run for the full possible contract term of 132 months, which also means that the value of the contract will be lower than originally anticipated.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d812', 'test_data_id': '536356-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': "Modification rendue nécessaire par des circonstances qu'un pouvoir adjudicateur/une entité adjudicatrice diligent(e) ne pouvait pas prévoir [article 43, paragraphe 1, point c), de la directive 2014/23/UE; article 72, paragraphe 1, point c), de la directive 2014/24/UE; article 89, paragraphe 1, point c), de la directive 2014/25/UE]"}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d819', 'test_data_id': '644753-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'W trakcie  realizacji  Umowy  stało  się  niemożliwe  wykonanie  zgodnie  z  uzgodnionym harmonogramem  realizacji  zakresu  Umowy,  migracji Systemu BSS Kontron do Systemu NSS Nokia i uruchomienie funkcjonalności A-flex i Gb-flex, z uwagi na okoliczności nadzwyczajne, których Zamawiający, działając z należytą starannością, nie mógł przewidzieć, tj. przedłużające się negocjacje w ramach powiązanego z  przedmiotowym  postępowaniem,  postępowania  zakupowego zmierzającego do zawarcia umowy na przełączenie posiadanych przez Zamawiającego Systemów BSS Kontron i BSS Nokia do Systemu NSS Nokia.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d81a', 'test_data_suite_id': 'sdk_examples_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d81b', 'test_data_id': 'can-modif_24_value', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'The original business case was scoped as a technology replacement programme for a single system. Analysis in the early stages of the programme indicated that two core enterprise systems should be replaced. In order to maximise benefit for these systems replacement activities, it was agreed that the organisation should consider people and process in addition to systems replacement, and work has been re-scoped to accommodate this.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d81a', 'test_data_suite_id': 'sdk_examples_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d821', 'test_data_id': 'can-modif_25', 'xpaths': [{'xpath': 'urn:ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Need for additional works, services or supplies by the original contractor.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d81a', 'test_data_suite_id': 'sdk_examples_can-1.11', 'test_data_oid': '67fbea0670ce61e9d6c0d826', 'test_data_id': 'can-modif_23', 'xpaths': [{'xpath': 'urn:ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Need for additional works, services or supplies by the original contractor.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d81a', 'test_data_suite_id': 'sdk_examples_can-1.11', 'test_data_oid': '67fbea0670ce61e9d6c0d827', 'test_data_id': 'can-modif_24_duration', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'The above contract is due to expire between 1 May 2020 and 31 December 2020. Due to the on-going COVID-19 outbreak and associated restrictions we are unable to implement the new ALMS Contract as anticipated. In line with Regulation 72(1)(c) of the PCR 2015 it is proposed to extend the above contract based on the following trust specific dates: Belfast Health & Social Care Trust – 31 October 2020 Western Health & Social Care Trust – 31 January 2021 Southern Health & Social Care Trust – 31 January 2021 Northern Health & Social Care Trust – 30 June 2021 (prices, terms & conditions to remain the same).'}]}], 'is_covered': True, 'xpath_conditions': [{'xpath_condition': '', 'meets_xpath_condition': True}], 'message': None}

{'sdk_element_id': 'BT-202-Contract', 'sdk_element_title': 'Modification Description', 'sdk_element_xpath': '/*/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'test_data_xpaths': [{'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d7f9', 'test_data_id': '447107-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': '1. W związku ze stwierdzeniem konieczności wykonania robót zamiennych, dodatkowych, rozszerzających zakres: 
1)	odtworzenie rozebranej nawierzchni drogowej i przywrócenia nawierzchni do stanu pierwotnego (ze względu na konieczność zachowania przejazdu 
dla autocystern na teren składu MPS podczas trwającego litrażowania zbiorników paliwowych roboty odtworzeniowe nawierzchni będą mogły rozpocząć się po zakończeniu pomiarów); 
2)	wykonanie dojścia do obiektu nr 31 (wykonanie dojścia jest niezbędne dla prawidłowego funkcjonowania obiektu oraz w celu skutecznego odbioru inwestycji przez organy Nadzoru Budowlanego);
3)	zamontowanie systemu grzania rur przewodem grzewczym oraz wykonania otuliny termoizolacyjnej w płaszczu ochronnym, 
4)	pomalowanie elewacji (ścian zewnętrznych) obiektów 11.1; do 11.6; 12.1; 12.2; 13; 14.1; 14.2; 14.3; 15.1; 15.2; 16.1; 16.2; 17, którego nie uwzględniono w przedmiarach (pozostawienie ścian zewnętrznych bez malowania doprowadzi do ich degradacji w wyniku działania warunków atmosferycznych);
5)	wykonanie większej ilość drogi patrolowej w stosunku do przedmiaru;
6)	zamiana sposobu wykonania stanowisk ogniowych na wniosek Użytkownika (zgodnie z dokumentacją projektową wzdłuż zewnętrznego ogrodzenia terenu MPS należy wykonać cztery stanowiska ogniowe. Użytkownik, podczas spotkania dotyczącego sprawdzenia zgodności zaprojektowanego ogrodzenia z wymogami normy obronnej zwrócił uwagę na trudność utrzymania w stanie suchym stanowisk zagłębionych poniżej terenu gruntu i wystąpił z propozycją zamiany przedmiotowych stanowisk na naziemne (wykonane z prostokątnych bali drewnianych);
7)	zamontowanie 7 szt. zasuw DN250 zgodnie z projektem, a w większej ilości względem przedmiaru (w przedmiarze branży sanitarnej występuje niedoszacowanie – 6 szt.);
oraz zaniechania części robót:
1)	wykonane ilości prac ziemnych polegających na wykopaniu, przemieszczeniu mas ziemnych i zasypaniu wykopów w ilości dostosowanej do potrzeb technologii wykonania tych prac, tj. ilości prac mniejszej niż przyjęto w przedmiarze;
2)	wykonanie 555 szt. igłofiltrów, tj. ilości igłofiltrów mniejszej niż przyjęto w przedmiarze (582 szt.);
3)	faktyczna powierzchnia dróg betonowych (TYP 1, 2, 3) okazała się mniejsza niż w przedmiarze, który był przeszacowany;
4)	faktycznie wbudowane ilości krawężnika okazały się mniejsze niż w przedmiarze, który był przeszacowany;
5)	wykonanie żelbetowej płyty fundamentowej bez izolacji pionowych i poziomych;
6)	w związku z wydzieleniem przez Zamawiającego z części zakresu prac objętych prawem opcji (budynek nr 04) Wykonawca nie wbudował separatora i  fundamentu dla separatora SEP-3, 
7)	wykonanie mniejszej ilość fundamentów niż określa przedmiar (w przedmiarze pozostawiono płytę fundamentową separatora SEP-3, po rezygnacji z wykonania budynku 04 wykonanie fundamentu pod separator SEP-3 
było bezzasadne);
8)	wykonanie mniejszej ilości opaski z kostki betonowej przy obiekcie nr 10 (w przedmiarze przeszacowano ilości robót do wykonania);
9)	wykonanie tynku cienkowarstwowego mozaikowego na elewacji budynku nr 06 w ilości 56,97 m2 (przedmiar był przeszacowany – występuje omyłka obliczeniowa);
10)	rzeczywiste ilości robót związanych z wykonaniem izolacji fundamentów i zasypek obiektu nr 09 są mniejsze (przedmiar był przeszacowany);
11)	w Protokole Konieczności nr 14, obejmującym swym zakresem rezygnację z instalacji cieplnej niskoparametrowej do budynków nierealizowanych (objętych prawem opcji) w pozycjach  dotyczących płukania sieci preizolowanej, prób szczelności rurociągów i uruchomienia rurociągów sieci cieplnych nastąpiła pomyłka obliczeniowa. Powyższe pozycje wyjęto z przedmiaru z działu sieci preizolowanych wysokoparametrowych, podczas gdy wyjęte powinny zostać pozycje odnoszące się do sieci niskoparametrowej;
12)	zamontowanie mniejszej ilości zasuw żeliwnych kołnierzowych PN16, DN 250 względem przedmiaru z branży sanitarnej (przedmiar sieci zewnętrznej WPP przewidywał montaż 6 szt. zasuw, natomiast projekt nie przewiduje montażu żadnej z przedmiotowych zasuw);
13)	wykonanie zgodnie z projektem instalacji zewnętrznej CO pod istniejącą drogą patrolową z kostki betonowej dodatkowych dwóch rur osłonowych o długości 7 mb każda (w przedmiarze występuje omyłka obliczeniowa – uwzględniono wykonanie 2 rur osłonowych pod drogą dojazdową do terenu MPS o długości 12 mb każda); na podstawie Protokołu konieczności nr 18 zatwierdzonego w dniu 24.05.2024 r., a także celem właściwego zrealizowania i rozliczenia zakresu rzeczowego zadania zawarto aneks nr 11 do umowy z dnia 08.07.2024 r. - zmiana na podstawie art. 455 ust. 1 pkt 1 i pkt 4 ustawy z dnia 11 września 2019 r. Prawo zamówień publicznych. 
2. Wartość przedmiotu umowy z wyłączeniem części przedmiotu umowy związanej z prawem opcji po zmianie (zmniejszenie wynagrodzenia): 98 573 054,59 zł netto (bez VAT), 121 244 857,15 zł brutto.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d807', 'test_data_id': '425773-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': 'Het engineeren, uitvoeren en onderhouden van CCTV systemen voor scheepvaartbegeleiding bij de verkeersposten Dordrecht, Tiel en Nijmegen. 
Deze wijziging betreft uitbreiding van het CCTV netwerk door het installeren en onderhouden van camera’s bij overnachtingshaven Spijk en de verkeerspost in Nijmegen.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d80d', 'test_data_id': '511729-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': 'In relation to the first modification, the Nomenclature of Economic Activities (“NACE”) index is used in the O&M Contract as part of the indexation provisions of the O&M Contract. Due to the Covid-19 pandemic, the indexation provisions in the O&M Contract produced an irrational outcome, in circumstances where the impact of the Covid-19 pandemic affected different categories of worker in very different manners. The primary reason for the NACE Index not increasing in line with the contractor’s wage increases was the unforeseen collapse of the airline industry due to the worldwide COVID-19 travel restrictions which resulted in many airline staff being made redundant between 2020 and 2021 and minimal wage increases for staff that were retained. This meant that between Quarter 2 of 2019 and Quarter 2 of 2020, there was a significant and unforeseen decrease for the air transport sub-sector of NACE (c. 32%) whereas the average decrease for the three other sub-sectors of NACE was marginal (c. 3%). This significant reduction in the air transport sub-sector of NACE (as a result of the impacts of Covid-19) had a disproportionate cumulative impact on NACE Principal Activity H for 2021 such that there was no increase.  
In relation to the second modification, the contracting authorities agreed certain reliefs at the outset of the Covid-19 pandemic which sought to limit the anticipated impacts on the contractor’s performance of the O&M Contract including measures which sought to limit the contractor’s increased exposure to System Performance Deductions in accordance with the variation mechanism under the O&M Contract as well as compensation for additional unforeseen costs related to providing a full service during the pandemic. It was agreed that these measures would be revisited at a later date. Upon review, it was agreed that the measures initially agreed were insufficient to compensate the operator for the additional costs and deductions incurred pursuant to the O&M Contract arising by virtue of the Covid-19 pandemic. 
In each case, TII is satisfied that the modifications were necessary to ensure the continued provision of the services pursuant to the O&M Contract, that the modifications were brought about by circumstances which a diligent contracting authority could not have foreseen (namely the Covid-19 pandemic) and that the modifications do not alter the overall nature of the O&M Contract.'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d812', 'test_data_id': '536356-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': "Immobilisations des ateliers de terrassement et de drainage depuis la notification du marché de travaux jusqu'au 30 septembre 2023 pour un montant de 589 649.79 euros hors taxes. Valeur totale actualisée du marché avant les modifications (prenant en compte les éventuelles modifications contractuelles et adaptations de prix antérieures pour un montant de 2 581 383,60 euros HT) : 44 453 871,29 euros HT Montant total du marché après les modifications : 45 043 521,08 euros HT"}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d7f5', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d819', 'test_data_id': '644753-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': 'Wydłużenie terminu realizacji zadania inwestycyjnego do 31.12.2025 r., przedłużenie terminu realizacji wsparcia technicznego do 15.12.2024 r.,'}]}, {'test_data_suite_oid': '67fbea0570ce61e9d6c0d81a', 'test_data_suite_id': 'sdk_examples_can-1.11', 'test_data_oid': '67fbea0570ce61e9d6c0d81b', 'test_data_id': 'can-modif_24_value', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLEx